'''Lunar rocks''' ('''Stalagmites''' in game) are rare rocks that can only be mined by players with 60 [[Mining]] during the [[Lunar Diplomacy]] quest or the [[The Fremennik Exiles|Fremennik Exiles]] quest. [[Lunar ore]] is mined at the stalagmites in the western part of the dungeon in north-east [[Lunar Isle]]. It can be smelted into a [[lunar bar]] through the [[Smithing]] skill and then made into a [[lunar helm]]. Other than that, the ore has no other use.


